import React from 'react';
import Header from '../../components/shared/Header';
import { Grid2, TextField } from '@mui/material';

const MOLForm = () => {
    return (
        <>
            <Header heading="Добавить МОЛ" />
            <Grid2>
                <TextField />
                <TextField />
                <TextField />
                <TextField />
                <TextField />
                <TextField />
                <TextField />
                <TextField />
                <TextField />
            </Grid2>
        </>
    );
};

export default MOLForm;
